import { Link, useNavigate } from "react-router-dom";
import {useState, useEffect} from "react";
import styles from '../styles.js';

function JudgeApp( { user } ) { 

    const navigate = useNavigate();

    const handleLogout = () => {
        navigate("/judge-manager/auth");
    };

    const handleAdminPage = () => {
        navigate("/judge-manager/app/user");
    };

    return (
        <div>
            {user == null ? 
            <div>
                <h1 style={styles.headingStyle}>Please log in</h1>
                <div style={styles.buttonContainerStyle}>
                    <button style={styles.buttonStyle} onClick={handleLogout}>Log in</button>
                </div>
            </div>
                : 
            <div>
                <h1 style={styles.headingStyle}>
                    Welcome
                </h1>
                <div style={styles.buttonContainerStyle}>
                    <button style={styles.buttonStyle} onClick={handleAdminPage}>Admin page</button>
                    <button style={styles.buttonStyle} onClick={handleLogout}>Logout</button>
                </div>
            </div>}
        </div>
    );
  }

  export default JudgeApp;
